const lengthOfLongestSubstring = function (s) {
  if (!s) return 0;

  let uniqueChars = "";
  let substrArr = [];

  for (let i = 0; i < s.length; i++) {
    if (uniqueChars) substrArr.push(uniqueChars);
    uniqueChars = "";
    uniqueChars += s[i];
    for (let j = i + 1; j < s.length; j++) {
      if (!uniqueChars.includes(s[j])) uniqueChars += s[j];
      else break;
    }
  }
  substrArr.push(uniqueChars);

  return substrArr.sort((a, b) => b.length - a.length)[0].length;
};

